import { useCallback } from "react";
import { useNavigate } from "react-router-dom";
import styles from "./Frame111.module.css";
import * as XLSX from "xlsx";

const Frame111 = () => {
  const navigate = useNavigate();
  const [wordData, setWordData] = useState(null);
  useEffect(() => {
    // Load data from Combined_MZ_Words.xlsx
    const fetchData = async () => {
      try {
        const response = await fetch("Combined_MZ_Words.xlsx");
        const arrayBuffer = await response.arrayBuffer();
        const data = new Uint8Array(arrayBuffer);
        const workbook = XLSX.read(data, { type: "array" });

        // Assuming your data is in the first sheet
        const sheetName = workbook.SheetNames[0];
        const sheet = workbook.Sheets[sheetName];

        // Convert the sheet data to JSON
        const jsonData = XLSX.utils.sheet_to_json(sheet);

        setWordData(jsonData);
      } catch (error) {
        console.error("Error loading data:", error);
      }
    };

    fetchData();
  }, []);
  const onRegisButtonContainerClick = useCallback(() => {
    navigate("/8");
  }, [navigate]);

  const onMZTextClick = useCallback(() => {
    navigate("/");
  }, [navigate]);

  const onMZText1Click = useCallback(() => {
    navigate("/");
  }, [navigate]);

  const onMZText3Click = useCallback(() => {
    navigate("/2");
  }, [navigate]);

  return (
    <div className={styles.div}>
      <div className={styles.child} />
      <div className={styles.regisButton} onClick={onRegisButtonContainerClick}>
        <div className={styles.regisButtonChild} />
        <div className={styles.mz}>MZ 신조어 등록</div>
      </div>
      <div className={styles.frameParent}>
        <div className={styles.parent}>
          <div className={styles.div1}>단어의 유래</div>
          <div className={styles.groupWrapper}>
            <div className={styles.wrapper}>
              <div className={styles.div2}>
                {/* Display English words from the data */}
                {wordData && wordData.map((word, index) => (
                  <p key={index} className={styles.p}>{word["영어 단어"]}</p>
                ))}
              </div>
            </div>
          </div>
        </div>
        <div className={styles.div3}>
          {/* Display English meanings from the data */}
          {wordData && wordData.map((word, index) => (
            <p key={index} className={styles.p}>{word["영어 뜻"]}</p>
          ))}
        </div>
      </div>
      {/* ... (continue with the rest of your JSX) */}
    </div>
  );

};

export default Frame111;
